INSERT INTO `paseador` VALUES (1,2,'amigable con las mascotas','https://res.cloudinary.com/dpdhhqact/image/upload/v1731092108/paseador_1.jpg',0),(18,3,NULL,NULL,0),(21,3,'Una mujer apasionada por el cuidado y la compañía de mascotas, con una dedicación excepcional hacia su bienestar y felicidad. Dotada de una naturaleza paciente y cariñosa, establece rápidamente vínculos afectivos con cada animal a su cuidado, asegurando paseos seguros y enriquecedores. Su compromiso con el cuidado animal se refleja en su profesionalismo y atención meticulosa a las necesidades individuales de cada mascota. Su empatía y habilidades comunicativas la convierten en una opción confiable y afectuosa para los dueños que buscan lo mejor para sus compañeros peludos.','image/upload/paseadores/foto_perfil_mujer.jpg',0),(23,5,'Un hombre dinámico y comprometido, con una pasión evidente por el bienestar animal y la naturaleza. Con habilidades excepcionales en el cuidado y manejo de mascotas, se destaca por su dedicación y amor hacia los animales. Posee una personalidad amigable y enérgica, lo que facilita una conexión natural con las mascotas y sus dueños. Además, cuenta con una sólida ética de trabajo y habilidades comunicativas, fundamentales para ofrecer un servicio profesional y de confianza en el cuidado y paseo de perros.','image/upload/paseadores/foto_perfil_hombre.jpg',0),(49,10,'Un paseador de mascotas dedicado y apasionado, con habilidades excepcionales en el cuidado y manejo de perros de todas las razas y tamaños. Con experiencia probada en asegurar paseos seguros y divertidos para los animales, garantizando tanto su bienestar físico como emocional. Destacado por su paciencia y empatía, adaptándose a las necesidades individuales de cada mascota. Además, posee una sólida comprensión de las diferentes personalidades caninas, facilitando una interacción armoniosa y enriquecedora durante cada salida.','image/upload/v1731105692/vgvbzdt67et9k0u0wdxb.png',11),(57,2,'amigable','https://res.cloudinary.com/dpdhhqact/image/upload/v1731078190/paseador_57.jpg',0),(59,2,'me encantan las mascotas','https://res.cloudinary.com/dpis0vb7j/image/upload/v1731587964/paseador_59.jpg',28),(70,3,'Me encantan las mascotas','https://res.cloudinary.com/dpis0vb7j/image/upload/v1731611197/paseador_70.jpg',44);
